import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import {
    auth,
    firebase
} from '../firebase/firebase.config';

function Login() {

    const promise1 = new Promise((resolve, reject) => {
        resolve('Success!');
      });
      function SignIn() {
          const email = document.getElementById("email");
          const password = document.getElementById("password");

          firebase.auth().signInWithEmailAndPassword(email, password)
          .then((userCredential) => {
            // Signed in
            var user = userCredential.user;
            // ...
          })
          .catch((error) => {
            var errorCode = error.code;
            var errorMessage = error.message;
          });
      }

    return (
    <div className="login-container">
        <div className="login">
            <form className="" noValidate autoComplete="off">
                <h2>Admin Panel-ზე შესვლა</h2>
                <br />
                <TextField label="ელ. ფოსტა" className="login-input" id="email" />
                <br />
                <TextField label="პაროლი" className="login-input" id="password" />
                <br/>
                <Button variant="contained" color="primary" onClick={SignIn}>Primary</Button>
            </form>
        </div>
    </div>
  );
}

export default Login;
